control.onControlLoad:
//鼠标点击行激活处理
g5.companyId = null;
g5.tableClick = function(sender) {
    var c, x, y;
    for (y = 0; y < g5.pageSize; y++) {
        for (x = 0; x < 4; x++) {
            c = ee.getTableCell(ee.getControl("tablebody2"), x, y);
            c.style.backgroundColor = "";    
        }
    }
    for (x = 0; x < 4; x++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), x, sender.rowIndex);
        c.style.backgroundColor = "#E0EEFF";
    }
    if (eb.isEmpty(g5.dataset1)) {
        g5.companyId = null;
        return;
    }
    g5.companyId = parseInt(g5.dataset1.getData(0, sender.rowIndex));
    g5.companyName = g5.dataset1.getData(2, sender.rowIndex);
    g5.companyNote = g5.dataset1.getData(3, sender.rowIndex);
}



//分页处理
g5.pageSize = 15;
g5.pageCurrent = 1;
g5.pageCount = 1;
g5.pageJump = function (pageNumber) {
    if (pageNumber < 1) pageNumber = 1;
    if (pageNumber > g5.pageCount) {
        pageNumber = g5.pageCount;
    }
    if (g5.pageCurrent != pageNumber) {
        g5.pageCurrent = pageNumber;
        if (g5.pageCurrent > 0) {
            query();
        }
    }
}

query();

control.onClick:
if (eb.isEmpty(g5.companyId) || isNaN(g5.companyId)) {
    alert("请选择有效的记录进行编辑");
    return;
}
ee.setText(ee.getControl("panel10"), g5.companyId);
ee.setEditText(ee.getControl("edit2"), g5.companyName);
ee.setEditText(ee.getControl("edit1"), g5.companyNote);

g5.operation = "edit";
ee.showAni(ee.getControl("panel1"));

if (eb.isEmpty(g5.companyId) || isNaN(g5.companyId)) {
    alert("请选择有效的记录进行操作");
    return;
}
if (!confirm("删除操作将导致不可返回的后果，如需恢复数据只有联系网管，您是否继续这个危险的操作？")) {
    return;
}
del();

taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");
if (companyId >= 0) {
    eio.appendString8("F");
    eio.appendString8("您没有足够的权限使用本功能");
    es.logWarning("您没有足够的权限使用本功能,userId=" + userId + ",companyId=" + companyId);
    return;
}

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(displayName like '%" + db.encode(searchText) + "%') or " +
        "(note like '%" + db.encode(searchText) + "%')) ";
}
sql = "select count(*) as c from company where status <> 'DEL'" + condition;   
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql=  "select * from company where status <> 'DEL'" + condition + "order by regDatetime DESC";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,displayName,note", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
    return;
}
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.user = eio.readString8();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody2"), g5.dataset1,0);   
ee.setText(ee.getControl("layoutxitem45"), g5.pageCurrent + "/" + g5.pageCount);
ee.setText(ee.getControl("panel16"), "共找到" +
    "<font color = '#d00000'>" + g5.pageRecordCount + "条</font>记录");

taskSetItem.script2:
var token = eio.readString8();
var modifyCompanyId = eio.readInt32();

//获取用户信息及认证
var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("您已经长时间没有登录系统了，请返回登录页面重新登录");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");
if (companyId >= 0) {
    eio.appendString8("F");
    eio.appendString8("您没有足够的权限使用本功能");
    es.logWarning("您没有足够的权限使用本功能,userId=" + userId + ",companyId=" + companyId);
    return;
}

//修改
sql = "exec companyDelete " +
    userId + "," +
    modifyCompanyId;
sqlResult = db.executeQuery("DB", sql); 
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getInt32(sqlResult, "errorCode") < 0) {
    eio.appendString8("F");
    eio.appendString8(db.getString(sqlResult, "errorString"));
    return;
}

eio.appendString8("T");
eio.appendString8(db.getString(sqlResult, "errorString"));

